import React from "react";
import { Sidenav } from "rsuite";

const SideNav = () => {
  return (
    <Sidenav>
      <Sidenav.Header>Insights</Sidenav.Header>
      <Sidenav.Header>Entry</Sidenav.Header>
    </Sidenav>
  );
};

export default SideNav;
